import React, {Component} from 'react';
import {Modal, Button, Row, Col, Form} from 'react-bootstrap';
import SnackBar from '@material-ui/core/Snackbar';
import IconButton from '@material-ui/core/IconButton';

export default class VaccinationEdit extends Component{
  constructor(props){
  super(props);
  this.state = {snackbaropen: false , snackbarmsg :''};
  this.handleSubmit = this.handleSubmit.bind(this);
  }
  
SnackBarClose = (event)=>{
  this.setState({snackbaropen : false});
}

handleSubmit(event){
  event.preventDefault();
  
  fetch(`http://localhost:3001/vaccination/update`,{
    method:'PUT',
    headers:{
      'Accept': 'application/json',
      'Content-Type' : 'application/json'
    },
    body:JSON.stringify({
      
    })
  })
  .then(res => res.json())
  .then((result)=>{
    this.setState({snackbaropen:true, snackbarmsg : result},
      (error)=>{
        this.setState({snackbaropen: true, snackbarmsg :'failed'})
      }
      )
  })
}
render(){
  return(
    <div className="container">
<SnackBar 
anchorOrigin={{vertical:'bottom', horizontal:'center'}}
open={this.state.snackbaropen}
autoHideDuration={3000}
onClose = {this.SnackBarClose}
message={<span id="message-id" > {this.state.snackbarmsg}</span>}
// action={{
//   <IconButton
//   key="close"
//   aria-label="close"
//   color="inherit"
//   onClick={this.SnackBarClose} >
  
  
  
// }}
/>
<Modal
{...this.props}
size="lg"
aria-labelledby ="contained-modal-title-vcenter"
centered
>
<Modal.Header closeButton>
  <Modal.Title id = "contained-modal-title-vcenter">
    Update Vaccination
  </Modal.Title>
</Modal.Header>
<Modal.Body>
  <Row>
    <Col sm ={6}>
      <Form onSubmit={this.handleSubmit}>
      <Form.Group as={Col}>
      <Form.Label className="v_id"  >Vaccination_id</Form.Label>
      <Form.Control type="text" disabled  name="v_id"  placeholder="Enter vaccination-id" />
    </Form.Group>
        <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="patient_id" >Patient-id</Form.Label>
      <Form.Control type="text" name="patient_id"   placeholder="Enter Patient-id" />
    </Form.Group>
    <Form.Group as={Col} >
      <Form.Label className="doctor_id" >Doctor-id</Form.Label>
      <Form.Control type="text" name="doctor_id"   placeholder="Enter doctor-id" />
    </Form.Group>
</Form.Row>
  <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="VC_id" >Vaccination Center ID</Form.Label>
      <Form.Control type="text" name="vc_id"    placeholder="Enter Vaccination Center Id" />
    </Form.Group>
    <Form.Group as={Col} >
      <Form.Label className="vaccine_id" >Vaccine-id</Form.Label>
      <Form.Control type="text" name="vaccine_id"   placeholder="Enter vaccine ID" />
    </Form.Group>
</Form.Row>
<Form.Row>
  <Form.Group >
      <Form.Label className="date" >Vaccination Date</Form.Label>
      <Form.Control type="text" name="date"  placeholder="Enter Vaccination Date" />
    </Form.Group>
    <Form.Group >
      <Form.Label className="time" >Vaccination Time</Form.Label>
      <Form.Control type="text" name="time"   placeholder="Enter Vaccination Date" />
    </Form.Group>
  </Form.Row>
  <Form.Row>
    <Form.Group as={Col} >
      <Form.Label className="result" >Vaccination Result</Form.Label>
      <Form.Control type="text" name="result"   placeholder="i-e Verify/Not Verify" />
    </Form.Group>
    <Form.Group as={Col}>
      <Form.Label className="reason">Vaccination Purpose</Form.Label>
      <Form.Control type="text" name="reason"   placeholder="Purpose" />
    </Form.Group>
  </Form.Row>

  <Button variant="primary"  type="submit">
    Update Vaccination
  </Button>
      </Form>
    </Col>
  </Row>
</Modal.Body>

<Modal.Footer>
  <Button variant="danger" onClick={this.props.onHide}>Close</Button>
</Modal.Footer>

</Modal>


    </div>
  )
}
}
